import axios from 'axios'
import Card from '../Card/Card'

export default class Home extends Component {
    state = {
        item: []
      }


    componentDidMount(){
        var self = this 
        axios.get(`http://localhost:3001/api`)
        .then(function (props) {
            let item = props.data;
            self.setState(item)
            console.log(item);
        }).catch((err) => console.log(err))
    }



   
    render(){ 
      const prueba = 'Hola'  
        return(
        this.state.item?.map((el)=>{ console.log('id', el.id, 'info' ,el.info,  'name',el.name, 'price',el.price, 'waist', el.waist);
         <div className="container">
             <h1>Tienda</h1> 
        
        <Card id={prueba} info={el.info} name={el.name} price={el.price} waist={el.waist}  />
        </div>
        
       }))
    }
}
